INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (1, "2020/04/30 12:00:00", "リン", 24001, 24, "2030/12/17 14:59:59", 0, "あたしだって\nやるときはやるよ！", 10040, 1, 0.0, 0.0, 102601, 0.0);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (1, "2020/04/30 12:00:00", "リン", 24002, 24, "2030/12/17 14:59:59", 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 10040, 1, 0.0, 0.0, 102601, 0.0);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (1, "2020/04/30 12:00:00", "リン", 24003, 24, "2030/12/17 14:59:59", 2, "終わった終わった\n一人でもなんとか\nなるもんだね", 10040, 1, 0.0, 0.0, 102601, 0.0);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (2, "2020/04/30 12:00:00", "リン", 24004, 24, "2030/12/17 14:59:59", 3, "やったね！\nこれでようやく\nサボれるよ…", 10040, 2, 0.0, 0.0, 102601, 0.0);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (1, "2020/04/30 12:00:00", "リン", 24005, 24, "2030/12/17 14:59:59", 4, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 10040, 1, 0.0, 0.0, 102601, 0.0);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (2, "2020/04/30 12:00:00", "リン", 24006, 24, "2030/12/17 14:59:59", 5, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 10040, 2, 0.0, 0.0, 102601, 0.0);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (2, "2020/04/30 12:00:00", "リン", 24007, 24, "2030/12/17 14:59:59", 6, "あたしも意外と\nやるもんでしょ？", 10040, 2, 0.0, 0.0, 102601, 0.0);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (4, "2020/04/30 12:00:00", "リン", 24008, 24, "2030/12/17 14:59:59", 7, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 10040, 4, 0.0, 0.0, 102601, 0.0);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (4, "2020/04/30 12:00:00", "リン", 24009, 24, "2030/12/17 14:59:59", 8, "このままじゃ\nまっひ～に\n叱られちゃうよ", 10040, 4, 0.0, 0.0, 102601, 0.0);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (4, "2020/04/30 12:00:00", "リン", 24010, 24, "2030/12/17 14:59:59", 9, "まじめに\nやったんだけどな…\n悔しいな～", 10040, 4, 0.0, 0.0, 102601, 0.0);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (4, "2020/04/30 12:00:00", "リン", 24011, 24, "2030/12/17 14:59:59", 10, "やられた…\nねずみって意外と\nてごわいね", 10040, 4, 0.0, 0.0, 102601, 0.0);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (4, "2020/04/30 12:00:00", "リン", 24012, 24, "2030/12/17 14:59:59", 11, "おのれ～\nあたしのチーズを\n盗みやがって～！", 10040, 4, 0.0, 0.0, 102601, 0.0);
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (1, "2020/04/30 12:00:00", "リン", 24013, 24, "2030/12/17 14:59:59", 12, "疲れた…\nけど、次こそは\n守り抜くよ…", 10040, 4, 1.81, 0.0, 102601, 0.0);
